import React, {Component} from "react";

class App extends Component{
    render(){
        return (
        <React.Fragment>
<h1> Hello Karachi</h1>
<h2>Hello Pakistan</h2>
<h3>My First App</h3>
        
        </React.Fragment>
        );
    }
}
export default App;
